Crouch, Basil E - The Darkside of the Moon, A Complete Course in Magic &amp; Witchcraft, 1987, 119 pages

This is an interesting look at witchcraft in general, and serves as a good introduction to the subject. Crouch presents details of his dabblings in the art without going into the theory behind the practices. Serious students of the arts will find this book lacking any real depth, and would be better served looking elsewhere, but it is a good introduction for those new to magic.


